__NUXT_JSONP__("/drugs/Litronesib", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"910634-41-2",chebiId:"",chemicalFormula:"C23H37N5O4S2",definition:"An inhibitor of the kinesin-related motor protein Eg5 with potential antineoplastic activity. Litronesib selectively inhibits the activity of Eg5, which may result in mitotic disruption, apoptosis and consequently cell death in tumor cells that are actively dividing. The ATP-dependent Eg5 kinesin-related motor protein (also known as KIF11 or kinesin spindle protein-5) is a plus-end directed kinesin motor protein that plays an essential role during mitosis, particularly in the regulation of spindle dynamics, including assembly and maintenance.",fdaUniiCode:"6611F8KYCV",identifier:"C88328",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C67440"],synonyms:["KF89617","LITRONESIB","LY2523355",a,"Propanamide, N-[4-(2,2-dimethyl-1-oxopropyl)-5-[[[[2-(ethylamino)ethyl]sulfonyl] amino]methyl]-4,5-dihydro-5-phenyl-1,3,4-thiadiazol-2-yl]-2,2-dimethyl-, (-)-"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FLitronesib",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Litronesib","2021-10-30T13:46:56.643Z")));